import React from 'react';

import { 
  Container,
  Imagem,
  DivInput,
  LogoImg,

 } from './styles';

 import logo from '../../assets/Image/Logo.png';
 import img1 from '../../assets/Image/image.png';

export default function signIn() {
  return (
    <Container>
      <DivInput>
        <LogoImg src={logo} />
        <h1>Sign Up</h1>
      </DivInput>
      <Imagem src={img1} />
    </Container>
  );
}
